(22, 'adcd@gmail.com', '3', '33', '30', 'Physics', NULL, 'JEE Main Physics', 'A time dependent force$ F\r\n=\r\n6t$ acts on a\r\nparticle of mass $1 kg$.  If the particle starts\r\nfrom rest, the work done by the force\r\nduring the first $1 sec$. will be $:$', '$4.5$ $J$', '$22$ $J$', '$9$ $J$', '$18$ $J$', NULL, NULL, NULL, NULL, 4.00, -0.50, 'A', NULL, 'easy', NULL, NULL, '2018-02-23 10:41:18', '2018-02-23 10:41:18'),
