(751, 'adcd@gmail.com', '3', '63', '68', 'Basic digital', NULL, 'JE', 'Given $(135)_{base x}$ + $(144)_{base x}$ = $(323)_{base x}$ ; what is the value of base x ?', '5', '3', '12', '6', NULL, NULL, NULL, NULL, 4.00, -1.00, 'D', NULL, 'none', NULL, NULL, '2018-07-07 21:18:05', '2018-07-07 21:18:05'),
(752, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'What is the value of b in the conversion $(16)_{10}$=$(100)_{b}$ ?', '2', '8', '6', '4', NULL, NULL, NULL, NULL, 4.00, -1.00, 'D', NULL, 'none', NULL, NULL, '2018-07-18 10:46:03', '2018-07-18 10:46:03'),
(753, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The minimum decimal equivalent of the number 11.C is ?', '183', '194', '268', '269', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-18 10:49:01', '2018-07-18 10:49:01'),
(754, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'What are the values respectively of $(R)_{1}$ and $(R)_{2}$ in the expression\r\n$(235)_{R_{1}}$ = $(565)_{10}$ = $(865)_{R_{2}}$', '8, 16', '16, 8', '6, 16', '12, 8', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-18 10:57:21', '2018-07-18 10:57:21'),
(755, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'How many bits are required to represent decimal value from -50 to 50 ?', 'At least seven bits.', 'At least six bits.', 'At least eight bits.', 'At least ten bits.', NULL, NULL, NULL, NULL, 4.00, -1.00, 'C', NULL, 'none', NULL, NULL, '2018-07-18 11:00:36', '2018-07-18 11:00:36'),
(756, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The most negative number that can be represented by an 8 bit signal 2\'s complement system is', '$(-127)_{10}$', '$(-128)_{10}$', '$(-64)_{10}$', '$(-256)_{10}$', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-18 11:04:05', '2018-07-18 11:04:05'),
(757, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The range of signed decimal numbers that can be represented by 6-bit 1\'s complement number is', '-31 to +31', '-63 to +64', '-64 to +63', '-32 to +31', NULL, NULL, NULL, NULL, 4.00, -1.00, 'A', NULL, 'none', NULL, NULL, '2018-07-18 11:07:20', '2018-07-18 11:07:20'),
(758, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', '2\'s complement representation of a 16-bit number (one sign bit and 15 magnitude bits ) is FFF1. Its magnitude in decimal representation is', '0', '1', '32, 767', '65, 535', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-18 11:10:30', '2018-07-18 11:10:30'),
(759, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The largest binary number that can be obtained using 16-bits is', '65536', '65535', '32768', '32767', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-18 11:12:26', '2018-07-18 11:12:26'),
(760, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'How many possible combinations of input variables exist in a 4-variable expression ?', '8', '10', '16', '24', NULL, NULL, NULL, NULL, 4.00, -1.00, 'C', NULL, 'none', NULL, NULL, '2018-07-18 11:14:08', '2018-07-18 11:14:08'),
(761, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The number of distinct Boolean expression of 4 variables is', '16', '256', '1024', '65536', NULL, NULL, NULL, NULL, 4.00, -1.00, 'D', NULL, 'none', NULL, NULL, '2018-07-18 11:19:20', '2018-07-18 11:19:20'),
(762, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'Which of the following notations have two representations of zero ?\r\n1. 1\'s complement with radix of number being 2.\r\n2. 7\'s complement with radix of number being 8.\r\n3. 9\'s complement with radix of number being 10.\r\n4. 10\'s complement with radix of number being 10.\r\nSelect the correct answer using the code given below', '1, 2 and 4.', '1 and 3.', '2, 3 and 4.', '1, 2 and 3.', NULL, NULL, NULL, NULL, 4.00, -1.00, 'D', NULL, 'none', NULL, NULL, '2018-07-18 22:29:15', '2018-07-18 22:29:15'),
(763, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'Which one of the following is the correct sequence of the numbers represented in the series given below ?\r\n$(2)_{3}$, $(10)_{4}$, $(11)_{5}$, $(14)_{6}$, $(22)_{7}$, ...', '2, 3, 4, 5, 6, ...', '2, 4, 6, 8, 10, ...', '2, 4, 6, 8, 10', '2, 4, 6, 10, 16, ...', NULL, NULL, NULL, NULL, 4.00, -1.00, 'D', NULL, 'none', NULL, NULL, '2018-07-18 23:10:04', '2018-07-18 23:10:04'),
(764, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'A logic gate is an electronic circuit which', 'operates on binary algebra.', 'performs arithmetic and logic functions.', 'allows flow of electrons only in one direction.', 'alternates between 0 and 1 values', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-19 22:30:30', '2018-07-19 22:30:30'),
(765, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The logic is said to be positive if', 'upper level is 0,  lower is 1.', 'lower level is 0, upper is 1.', 'two levels overlap.', 'both (A) and (B) are true.', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-21 19:45:52', '2018-07-21 19:45:52'),
(766, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The voltage levels of a negative logic system', 'must necessarily be negative.', 'may be negative or positive.', 'must necessarily be positive.', 'must necessarily be 0 and -5 V.', NULL, NULL, NULL, NULL, 4.00, -1.00, 'B', NULL, 'none', NULL, NULL, '2018-07-21 21:18:42', '2018-07-21 21:18:42'),
(767, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'If L = low, H = high , a positive logic is', 'L = 5 V, H = 0 V', 'L = 5 V, H = -5 V', 'L = 5 V, H = 1 V', 'L = -5 V, H = -1 V', NULL, NULL, NULL, NULL, 4.00, -1.00, 'D', NULL, 'none', NULL, NULL, '2018-07-21 21:23:23', '2018-07-21 21:23:23'),
(768, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'A positive logic OR gate is the same as the negative logic', 'NOR gate.', 'OR gate.', 'EX-OR gate.', 'AND gate.', NULL, NULL, NULL, NULL, 4.00, -1.00, 'D', NULL, 'none', NULL, NULL, '2018-07-21 21:27:06', '2018-07-21 21:27:06'),
(769, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'Three Boolean operators are:', 'NOT, OR, AND.', 'NOT, NAND, OR.', 'NOR, OR, NOT', 'NOR, NAND, NOT.', NULL, NULL, NULL, NULL, 4.00, -1.00, 'A', NULL, 'none', NULL, NULL, '2018-07-21 21:30:12', '2018-07-21 21:30:12'),
(770, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'The only function of a NOT gate is to', 'invert an input signal.', 'act as a universal gate.', 'stop a signal.', 'none of the above.', NULL, NULL, NULL, NULL, 4.00, -1.00, 'A', NULL, 'none', NULL, NULL, '2018-07-21 21:33:26', '2018-07-21 21:33:26'),
(771, 'adcd@gmail.com', '3', '62', '67', 'digital electronics', NULL, 'JE', 'When an input electrical will be signal A = 101010 is applied to a NOT gate, the output signal will be', '111010', '101010', '010101', '101011', NULL, NULL, NULL, NULL, 4.00, -1.00, 'C', NULL, 'none', NULL, NULL, '2018-07-21 21:40:31', '2018-07-21 21:40:31');
